    return (
        <div>
        {   
             props.book.items.map((bookss, i) => {
                    return <BookCard
                    key={i}
                 img={bookss.items.volumeInfo.imageLinks.thumbnail}
                    title={bookss.items.title}
                    author={bookss.items.authors}
                    download={bookss.items.authors}
                    />
                })
            }







            <img src={props.book.items.image} alt=" "/>
            <h2>{props.title}</h2>
            <h2>{props.autor}</h2>
            <p>{props.download}</p>
        </div>
    )
}
